volatile int pixel_buffer_start; // global variable
volatile char *character_buffer = (char *) 0xC9000000;// VGA character buffer
volatile int *LEDR_ptr = (int *) 0xFF200000;

//VGA boundaries
const int VGA_X_MIN = 1;
const int VGA_X_MAX = 318;
const int VGA_Y_MIN = 1;
const int VGA_Y_MAX = 238;
const int GROUND_Y_START = 200;

//Player struct definiton
struct Player{
    int x;
    int y;
    int x_size;
    int y_size;
    int y_dir;
    int x_dir;
};

//obstacle struct definition
struct Obstacle{
    int x;
    int y;
    int x_speed;
    int width;
    int height;
};

//Linked list of obstacles
struct node{
    struct Obstacle data;
    struct node *next;
};


//Function prototypes:
void clear_screen();
void wait_for_vsync();
void plot_pixel(int x, int y, short int line_color);
void draw_player(int x, int y, int x_size, int y_size, int offset);
struct node* spawn_obstacle(struct node* head);
struct node* draw_obstacle(struct node* head); 
struct Obstacle create_obstacle();
bool collision(struct Player player);
void printTextOnScreen(int x, int y, char *scorePtr);
void draw_obstacle_helper(struct node* curr, int offset);
void draw_background_helper(struct node* curr, int offset);

int main(void){
    //Initialize the score to 0
    int totalScore = 0;
    int scoreOnes = 0;
    int scoreTens = 0;
    int scoreHundreds = 0;
    *LEDR_ptr = 0;
    int timeCount = 0;

    //Initialize FPGA 
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020; //Vga buffer
    volatile int* PS2_ptr = (int *) 0xFF200100; // ps2 keyboard
   
    *(pixel_ctrl_ptr + 1) = 0xC8000000;                                      
    wait_for_vsync();
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); 
    
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    
    //Player attributes
    const int PLAYER_X_SIZE = 75;
    const int PLAYER_Y_SIZE = 43;
    const int PLAYER_START_X = 75;
    const int PLAYER_START_Y = 185;

    //initialize player
    struct Player player;
    player.x = PLAYER_START_X;
    player.y = PLAYER_START_Y;
    player.y_dir = 0;
    player.x_dir = 0;
    player.x_size = PLAYER_X_SIZE;
    player.y_size = PLAYER_Y_SIZE;


    //Initialize obstacles 
    //Make linked list of obstacles
    //new obstacles always are at the end of the screen (end of list)
    //when obstacles get off screen: -> delete head of list
    struct node *head = NULL;

    //Initialize Ps2 Keyboard data
    int PS2_data;
    unsigned char data_in = 0;

    bool gameOver = false;
    clear_screen();

    //Main game loop
    while(!gameOver){
        timeCount++;

        // Plot score
        if (timeCount == 20) {
            timeCount = 0;
            totalScore++;
            scoreHundreds = totalScore / 100;
            scoreTens = (totalScore - scoreHundreds * 100) / 10;
            scoreOnes = totalScore - scoreHundreds * 100 - scoreTens * 10;
            *LEDR_ptr = totalScore;
        }

        char myScoreString[15];
        myScoreString[0] = 'M';
        myScoreString[1] = 'Y';
        myScoreString[2] = ' ';
        myScoreString[3] = 'S';
        myScoreString[4] = 'C';
        myScoreString[5] = 'O';
        myScoreString[6] = 'R';
        myScoreString[7] = 'E';
        myScoreString[8] = ':';
        myScoreString[9] = ' ';

        if (scoreHundreds != 0) {
            myScoreString[10] = scoreHundreds + '0';
        } 
        
        else {
            myScoreString[10] = ' ';
        }
        
        if (scoreHundreds == 0 && scoreTens == 0) {
            myScoreString[11] = ' ';
        } 
        
        else {
            myScoreString[11] = scoreTens + '0';
        }
        
        myScoreString[12] = scoreOnes + '0';
        myScoreString[13] = '\0';
        
        printTextOnScreen(285, 0, myScoreString);

        PS2_data = *PS2_ptr;
        data_in = PS2_data & 0xFF;

        //Gets direction code
        if(data_in == 0x1B && player.y + player.y_size < VGA_Y_MAX)
        {
            player.x_dir = 0;
            player.y_dir = 2;
        }
        else if(data_in == 0x1D && player.y > VGA_Y_MIN)
        {
            player.x_dir = 0;
            player.y_dir = -2;
        }
        else if(data_in == 0x1C && player.x > VGA_X_MIN)
        {
            player.y_dir = 0;
            player.x_dir = -2;
        }
        else if(data_in == 0x23 && player.x + player.x_size < VGA_Y_MAX)
        {
            player.y_dir = 0;
            player.x_dir = 2;
        }
        
        // Erases player
        //draw_background_helper(player.x, player.y, player.x_size, player.y_size, SpaceBackground_map, 3);
        clear_screen();

        //updates new player direction
        player.y += player.y_dir;
        player.x += player.x_dir;
        // Draw player
        draw_player(player.x, player.y, player.x_size, player.y_size, 0);
 
        head = spawn_obstacle(head);
        //clear_bg(head);
        head = draw_obstacle(head);

        gameOver = collision(player);

        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); 
    }

}

//forwards player collision detection using color detection
bool collision(struct Player player)
{
    int a = 0, b = 0;
    for(int x = player.x; x < player.x + player.x_size; x++)
    {
        for(int y = player.y; y < player.y + player.y_size; y++)
        {
            if( *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) == Asteroid_map[30 * b + a - 1])
            {
            printf("Oh no we hit something \n");
            //return true;
            }
            b++;
        }
        b = 0;
        a++;
    }

    return false;
}


